import React from "react";
import { Box, Image } from "@chakra-ui/react";

import logo from "../images/logo.svg";

const Header = () => {
  return (
    <Box
      display="flex"
      justifyContent="flex-start"
      bg="red.300"
      maxWidth={{ base: "100%", sm: "100%", md: "100%", lg: "730px" }}
    >
      <Image src={logo} />
    </Box>
  );
};

export default Header;
